import React, { Component } from 'react';


class Text extends Component{
    constructor(name,job){
        this.name = name;
        this.job = job;
    }
    render(){
        return (
            <div>
                <Text name="Sultan" job="Web Developer" />
            </div>
        )
    }
}
export default Text;
